        FORTNITE_GIFT_INVENTORY_INFO:
          "Dopasuj sprzęt do {guardOutfitName}!\n\nOd 4 maja możesz odblokować drop Discorda {rewardName}, wykonując jedną z następujących dw\xf3ch czynności:\n\nStreamuj Fortnite na żywo ze wsp\xf3łdzieleniem ekranu na Discordzie przez ponad 15 minut dla przynajmniej jednego znajomego w serwisie Discord.\n\nPo 15 minutach wsp\xf3łdzielenia ekranu ze znajomym otrzymasz łącze w postaci prezentu w menu Ustawienia > Ekwipunek prezent\xf3w.\n\nKliknij łącze, aby zalogować się na konto Epic Games, a malowanie zostanie dodane do Twojej Szafki w Fortnite!\n\nNie jesteś w stanie streamować? Możesz też przyjąć misję bota Discorda! W tym celu dołącz do [oficjalnego serwera Fortnite na Discordzie](http://discord.gg/fortnite).\n\nNa serwerze zobaczysz bota, z kt\xf3rym możesz wejść w interakcję, aby przystąpić do misji Discorda.\n\nPo wejściu w interakcję z botem nastąpi przekierowanie do strony, gdzie możesz połączyć swoje konta Epic i Discord.\n\nPo połączeniu kont weź udział w misji, wykonując zadanie w Discordzie i w Fortnite.\n\nPo wykonaniu obu zadań malowanie zostanie dodane do Twojej Szafki Fortnite!\n\nWięcej informacji znajdziesz w naszym poście na blogu!\n",
